from recipe.models import Recipe
import random
from account.models import Account
from django.utils import timezone

import requests # to get image from the web
import shutil # to save it locally
import os
from django.core.files.storage import FileSystemStorage
from django.core import files
from django.conf import settings
from PIL import Image

def load_recipes():
	mitch = Account.objects.get(pk=1)
	blake = Account.objects.get(pk=2)
	jessica = Account.objects.get(pk=3)
	maizy = Account.objects.get(pk=4)
	kiba = Account.objects.get(pk=5)
	for recipe in recipes_raw:
		try:
		
			rating = random.randint(1,101)
			if rating > 0 and rating <= 20:
				publisher = mitch
			elif rating > 20 and rating <= 40:
				publisher = jessica
			elif rating > 40 and rating <= 60:
				publisher = blake
			elif rating > 60 and rating <= 80:
				publisher = maizy
			elif rating > 80 and rating <= 100:
				publisher = kiba
			ingredients = {}
			for ingredient in recipe['ingredients']:
				ingredients[ingredient] = ""


			new = Recipe.objects.create(
				title=recipe['title'],
				rating=rating,
				publisher=publisher,
				source_url=recipe['source_url'],
				description="N/A",
				ingredients=ingredients,
				date_updated=timezone.now()
			)
			new.save()

			# Download and save the image to model
			if not os.path.exists(settings.TEMP):
				os.mkdir(settings.TEMP)
			if not os.path.exists(f"{settings.TEMP}/{recipe['recipe_id']}"):
				os.mkdir(f"{settings.TEMP}/{recipe['recipe_id']}")
			
			# Open the url image, set stream to True, this will return the stream content.
			r = requests.get(recipe['image_url'], stream = True)
			# Check if the image was retrieved successfully
			if r.status_code == 200:
				# Set decode_content value to True, otherwise the downloaded image file's size will be zero.
				r.raw.decode_content = True

				url = os.path.join(f"{settings.TEMP}/{recipe['recipe_id']}/featured_image.png")
				storage = FileSystemStorage(location=url)
				with storage.open('', 'wb+') as destination:
					shutil.copyfileobj(r.raw, destination)
				new.featured_image.save("featured_image.png", files.File(storage.open(url)))
			else:
				print('Image Couldn\'t be retreived')
				new.delete()
			try:
				os.remove(os.path.join(f"{settings.TEMP}/{recipe['recipe_id']}/featured_image.png")) # delete the temp image 
				os.remove(os.path.join(f"{settings.TEMP}/{recipe['recipe_id']}")) # delete the temp image dir
			except Exception as e:
				pass
			
		except Exception as e:
			print(f"Exception in 'load_recipes': {e}")
			raise e

	
















